content:
도착하자마자..정말 미치듯이 갉아대더니
하루지나니 시들 ^^;;;
  사은품으로 받은 소형은 입에  대지도 않음

사이즈별로 색깔이 반대로 왔네여;
쓰는데는 문제없어서 그냥 쓸게요 
강아지가 가지고 노는걸 좋아해요

보자마자 좋아할 줄 알았는데
시간이 좀 필요한가봐요^^;
주신 간식은 잘 먹었어요 ㅎㅎ

2개를 사서 하나는 포메에게 선물하고 저희는 웰시가 씁니다.
포메에게는 주둥이가 짧아서 바닥에 작은 사료를 넣으면 못 먹는 상황이 발생했어요;;;
그래서 큰 사료를 넣어주거나, 아님 바닥에 뭘 깔아서 높이를 높여야 할 것 같아요

엄청 좋아하고 잘 씹는데, 가끔 이빨에 걸리면 빼는게 힘드네요ㅠㅠ
나무 자체가 부드러워서 거의 그럴 일이 없는데, 겁도 많고 엄살도 심해서 한 번 이빨에 끼면 한동안 안 가지고 노네요ㅎㅎ;;
나무 조각들이 많이 나와서 주로 마당에서 줍니다!

대만족이에요. 세.나.개. 보고 구매했거든요.
저희 집 똥멍청이(?)가 완전 좋아하더라구요~~^^;; 
강추입니다!!

이건 머리카락아닌가요????;;;;;;;
오자마자 뜯어서 주고 보니 낑겨잇어서 잡아땡기니까
끊어졋는데 머리카락같아요;;
그리고 준지 한 10분 정도 된거같은데 가죽은 없는게 좋겟어요 다 뜯어먹엇네요;;;;

2개월짜리 650g 아가한텐 알사탕 크기가 너무커요ㅋ
아가 머리보다 큰듯;
더 크면 가지고놀껀가봐요ㅋ 아직은 잘..

입마개 사러 왔다가  싸길래 입마개 구입하면서 우리강아지 하나 사줘봤는데 잘때도 끌어안고 자네요^^; 
우리 강아지가 베프 생겼네요
말랑 말랑해서 다칠염려 없고 소리도 잘나서 재미 있어 하고 참 좋아하네요^^

재구매합니다. 오렌지랑 그린이 낡아서 보내주고 레드 구매했습니다.
이 장난감 가지고 노는걸 참 좋아합니다.
제가 생각하기에 말랑해서 이에 무리가 덜 가지 않을까 싶어 또 샀습니다. ^^;;

코끼리대신 토끼로 대체해서 받길 잘한거같아요;
이자식이 코끼리는 쳐다도안보구 토끼만 씹고뜯고맛보고있어요 토끼에 집착이 굉장해요; 
조만간 또 토끼인형이 젤 먼저 뜯어질거같아요
친절하신 판매자님이 코끼리도 같이주셨단말야 이제 새로운친구랑도 놀으라그..
지금 토순이 울애기 최애입니다
토끼랑 코끼리 다 감사해용 늦은 후기죄송합니당 ㅠ

물고 뜯고 잡아 흔들다가 
주둥이랑 등부위가 터졌어요 ;
튼튼한줄알았는데 ㅠㅠ 아까워서 꼬매서 사용중이에요

댕댕이가 좋아라 했고 신나게 가지고 놀았던거에 만족합니다.
단지 아무래도 계속 씹으면 오래 버티지는 못하는거 같아요. 씹기 시작하니 20분? 못 넘기고 망가졌어요 ㅎㅎ;;;

댕댕이가 계속 씹지 않고
던지면 물어오고 또는 혼자 물고 던지고 그런식으로 가지고 놀면
오래 갈거 같은데
저희는 계속 씹으며 놀다가.. ㅎㅎ;;

원래는 외출할 때 쓰려고 산 노즈워크인데 요즘 같이 산 돌돌이를 쓰면서 너무 많이 먹고 급하게 먹는 것 같아서 부직포 노즈워크랑 윈드밀 4단 노즈워크, 투웬티 노즈워크, 돌돌이까지 해서 총 4개의 노즈워크에 소량의 사료를 넣어서 오랫동안 먹게 하고 있어요ㅎㅎ

너무 잘 써서 좋은데 요즘 4개를 바닥에 내려놓기 무섭게 순식간에 다 클리어하더라고요;; 
분명 어려운 노즈워크라고 해서 구매했는데ㅠ 요령을 빨리 터득한 것 같아서 이번에 더 어려운 노즈워크 2개만 더 구매해서 집에 있는 4개랑 같이 사용해 보려고요!

아이가 너무 좋아하는 장난감입니다. 
가격도 저렴하게 잘 샀네요 :) 
다양한 색상을 기대하고 5개 주문했는데 색상은 빨간색 3개, 연두색 2개 와서 좀 아쉽네요;

잘받았습니다. 보내주신 서비스도 감사합니다.
사이즈가 생각보다 굉장히 작더라고요^^;
큰것도 금방 뜯겨나가서 일부러 오래 가지고 놀으라고 많이주문했는데 거의 30분만에 3개는 분해되고 다음번에 주려고요ㅎㅎ 공이라면 간식도 안먹는 아이라서 좋아하니 다행이예요

개가 너무 좋아해요 ㅎㅎ
저는 너무 힘들지만.. ;;;
그래도 엄청 튼튼해서 오래 쓸거같아요
